import React, { useState } from "react";
import { FaEnvelope, FaMapMarkerAlt, FaPhone, FaWhatsapp, FaInstagram } from "react-icons/fa";

const Contact = () => {
  const [formData, setFormData] = useState({
    name: "",
    title: "",
    description: "",
  });

  const [message, setMessage] = useState("");

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setMessage("Your query has been submitted. We'll get back to you soon!");
    setFormData({ name: "", title: "", description: "" });
  };

  return (
    <section className="container mx-auto px-6 py-16">
      <h2 className="text-3xl font-bold text-center mb-10 text-gray-800">Contact Us</h2>

      <div className="grid md:grid-cols-2 gap-12 items-start">
        {/* Query Form - Left Side */}
        <div className="bg-white p-8 rounded-xl shadow-lg border border-gray-200">
          <h3 className="text-2xl font-semibold mb-6 text-gray-700">Send Us a Query</h3>

          <form onSubmit={handleSubmit} className="space-y-5">
            <div>
              <label className="block text-gray-700 font-medium mb-1">Name</label>
              <input
                type="text"
                name="name"
                value={formData.name}
                onChange={handleChange}
                className="w-full border border-gray-300 rounded-lg p-3 focus:outline-none focus:ring-2 focus:ring-blue-500"
                required
              />
            </div>

            <div>
              <label className="block text-gray-700 font-medium mb-1">Title</label>
              <input
                type="text"
                name="title"
                value={formData.title}
                onChange={handleChange}
                className="w-full border border-gray-300 rounded-lg p-3 focus:outline-none focus:ring-2 focus:ring-blue-500"
                required
              />
            </div>

            <div>
              <label className="block text-gray-700 font-medium mb-1">Description</label>
              <textarea
                name="description"
                value={formData.description}
                onChange={handleChange}
                className="w-full border border-gray-300 rounded-lg p-3 h-28 focus:outline-none focus:ring-2 focus:ring-blue-500"
                required
              ></textarea>
            </div>

            <button
              type="submit"
              className="w-full bg-gradient-to-r from-blue-500 to-indigo-600 text-white py-3 rounded-lg text-lg font-semibold hover:from-indigo-600 hover:to-blue-500 transition duration-300"
            >
              Submit
            </button>
          </form>

          {message && <p className="mt-4 text-green-600 text-center">{message}</p>}
        </div>

        {/* Contact Details - Right Side */}
        <div className="space-y-6 bg-gray-100 p-8 rounded-xl shadow-lg border border-gray-200">
          <h3 className="text-2xl font-semibold text-gray-700 mb-4">Contact Details</h3>

          <div className="flex items-center gap-4">
            <FaEnvelope className="text-2xl text-blue-600" />
            <p className="text-lg font-medium">bikers@trailriders.in</p>
          </div>

          <div className="flex items-center gap-4">
            <FaMapMarkerAlt className="text-2xl text-red-600" />
            <p className="text-lg font-medium">Brookfield, Bangalore 560037</p>
          </div>

          <div className="flex items-center gap-4">
            <FaPhone className="text-2xl text-green-600" />
            <p className="text-lg font-medium">+91 7259770330</p>
          </div>

          <div className="flex items-center gap-4">
            <FaWhatsapp className="text-2xl text-green-500" />
            <p className="text-lg font-medium">+91 7259770330</p>
          </div>

          <div className="flex items-center gap-4">
            <FaInstagram className="text-2xl text-pink-500" />
            <p className="text-lg font-medium">@trailriders.in</p>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Contact;
